/* Table of index changes */
const int16_t IndexTable[16] = {
                                -1, -1, -1, -1, 2, 4, 6, 8,
                                -1, -1, -1, -1, 2, 4, 6, 8
};

/* Quantizer step size lookup table */
const int32_t StepSizeTable[89] = {
                                   7, 8, 9, 10, 11, 12, 13, 14, 16, 17,
                                   19, 21, 23, 25, 28, 31, 34, 37, 41, 45,
                                   50, 55, 60, 66, 73, 80, 88, 97, 107, 118,
                                   130, 143, 157, 173, 190, 209, 230, 253, 279, 307,
                                   337, 371, 408, 449, 494, 544, 598, 658, 724, 796,
                                   876, 963, 1060, 1166, 1282, 1411, 1552, 1707, 1878, 2066,
                                   2272, 2499, 2749, 3024, 3327, 3660, 4026, 4428, 4871, 5358,
                                   5894, 6484, 7132, 7845, 8630, 9493, 10442, 11487, 12635, 13899,
                                   15289, 16818, 18500, 20350, 22385, 24623, 27086, 29794, 32767
};

int32_t diff = 0;               /* Difference between sample and predicted sample */
int32_t step = 0;                      /* Quantizer step size */
int32_t predsample = 0;         /* Output of ADPCM predictor */
int32_t diffq = 0;              /* Dequantized predicted difference */
int16_t index = 0;                      /* Index into step size table */
int32_t   prevsample = 0;             /* Predicted sample */
int16_t   previndex = 0;               /* Index into step size table */

/*****************************************************************************
 *       ADPCMEncoder - ADPCM encoder routine                                 *
 ******************************************************************************
 *       Input Variables:                                                     *
 *               signed long sample - 16-bit signed speech sample             *
 *       Return Variable:                                                     *
 *               char - 8-bit number containing the 4-bit ADPCM code          *
 *****************************************************************************/
uint8_t ADPCMEncoder(int16_t sample)
{
    uint8_t code;               /* ADPCM output value */
    int32_t tempstep;           /* Temporary step size */
    /* Restore previous values of predicted sample and quantizer step
   size index
     */
    predsample = prevsample;
    index = previndex;
    step = StepSizeTable[index];
    /* Compute the difference between the actual sample (sample) and the
   the predicted sample (predsample)
     */
    diff = (int32_t)sample - predsample;
    if(diff >= 0)
        code = 0;
    else
    {
        code = 8;
        diff = -diff;
    }
    /* Quantize the difference into the 4-bit ADPCM code using the
   the quantizer step size
     */
    tempstep = step;
    if( diff >= tempstep )
    {
        code |= 4;
        diff -= tempstep;
    }
    tempstep >>= 1;
    if( diff >= tempstep )
    {
        code |= 2;
        diff -= tempstep;
    }
    tempstep >>= 1;
    if( diff >= tempstep )
        code |= 1;
    /* Inverse quantize the ADPCM code into a predicted difference
   using the quantizer step size
     */
    diffq = step >> 3;
    if( code & 4 )
        diffq += step;
    if( code & 2 )
        diffq += step >> 1;
    if( code & 1 )
        diffq += step >> 2;
    /* Fixed predictor computes new predicted sample by adding the
   old predicted sample to predicted difference
     */
    if( code & 8 )
        predsample -= diffq;
    else
        predsample += diffq;
    /* Check for overflow of the new predicted sample
     */
    if( predsample > 32767 )
        predsample = 32767;
    else if( predsample < -32768 )
        predsample = -32768;
    /* Find new quantizer stepsize index by adding the old index
   to a table lookup using the ADPCM code
     */
    index += IndexTable[code];
    /* Check for overflow of the new quantizer step size index
     */
    if( index < 0 )
        index = 0;
    if( index > 88 )
        index = 88;
    /* Save the predicted sample and quantizer step size index for
   next iteration
     */
    prevsample = predsample;
    previndex = index;
    /* Return the new ADPCM code */
    return ( code & 0x0f );
}

/*****************************************************************************
 *       ADPCMDecoder - ADPCM decoder routine                                 *
 ******************************************************************************
 *       Input Variables:                                                     *
 *               char code - 8-bit number containing the 4-bit ADPCM code     *
 *       Return Variable:                                                     *
 *               signed long - 16-bit signed speech sample                    *
 *****************************************************************************/
int16_t ADPCMDecoder(uint8_t code )
{
    /* Restore previous values of predicted sample and quantizer step
   size index
     */
    predsample = prevsample;
    index = previndex;
    /* Find quantizer step size from lookup table using index
     */
    step = StepSizeTable[index];
    /* Inverse quantize the ADPCM code into a difference using the
   quantizer step size
     */
    diffq = step >> 3;
    if( code & 4 )
        diffq += step;
    if( code & 2 )
        diffq += step >> 1;
    if( code & 1 )
        diffq += step >> 2;
    /* Add the difference to the predicted sample
     */
    if( code & 8 )
        predsample -= diffq;
    else
        predsample += diffq;

    /* Check for overflow of the new predicted sample
     */
    if( predsample > 32767 )
        predsample = 32767;
    else if( predsample < -32768 )
        predsample = -32768;
    /* Find new quantizer step size by adding the old index and a
   table lookup using the ADPCM code
     */
    index += IndexTable[code];
    /* Check for overflow of the new quantizer step size index
     */
    if( index < 0 )
        index = 0;
    if( index > 88 )
        index = 88;
    /* Save predicted sample and quantizer step size index for next
   iteration
     */
    prevsample = predsample;
    previndex = index;
    /* Return the new speech sample */
    return( (int16_t)predsample );
}


/*
 * ********************************************************************
 * @brief Handler function to perform ADPCM encoding on each 5-sec
 *        sensor recording, i.e., "fdata"
 *
 *  @param float32_t* fIn      Src Pointer to input  5-sec "fdata" array
 *           uint8_t* eOut     Dst Pointer to output "encoded" array
 *          uint32_t  eLen     Number of Bytes of fIn and eOut (Both Must be Same)
 *
 *  @return None
 *
 *  @example doEncoding((float32_t*)fdata,encoded,DATASIZE);
 *  *******************************************************************
 */
void doEncoding(float32_t* fIn, uint8_t* eOut, uint32_t eLen){
    doEncodingInit(); // Initialize variable for 5-sec ADPCM encoding
    memset(eOut,0,eLen);
    for (uint32_t idx = 0; idx<eLen;idx++) {
        eOut[idx] = (uint8_t) ADPCMEncoder((int16_t)floor(fIn[idx]*1000.0f));
    } // for idx=1:DATASIZE
}// doEncoding()

void doEncodingInit(){

    diff = 0;               /* Difference between sample and predicted sample */
    step = 0;               /* Quantizer step size */
    predsample = 0;         /* Output of ADPCM predictor */
    diffq = 0;              /* Dequantized predicted difference */
    index = 0;              /* indexx into step size table */
    prevsample = 0;         /* Predicted sample */
    previndex = 0;          /* indexx into step size table */
} // doEncodingInit()


/*
 * ********************************************************************
 * @brief Handler function to perform ADPCM encoding on each 5-sec
 *        sensor recording, i.e., "fdata"
 *
 *  @param   uint8_t* eIn     Src Pointer to output "encoded" array
 *         float32_t* fOut    Dst Pointer to input  5-sec "fdata" array
 *          uint32_t  eLen    Number of Bytes of fIn and eOut (Both Must be Same)
 *
 *  @return None
 *
 *  @example doEncoding((float32_t*)fdata,encoded,DATASIZE);
 *  *******************************************************************
 */
void doDecoding(uint8_t* eIn,float32_t* fOut, uint32_t eLen){
    doEncodingInit(); // Initialize variable for 5-sec ADPCM decoding
	for (uint32_t idx = 0; idx<eLen;idx++) {
        fOut[idx] = ((float32_t) ADPCMDecoder((uint8_t)(eIn[idx])))/1000.0f;
	} // for idx=1:DATASIZE
}// doEncoding()
